import {
  AppBar,
  Box,
  Button,
  IconButton,
  Toolbar,
  Typography,
} from "@mui/material";
import MyButton from "./MyButton";

const Header = () => {
  return (
    <>
      <AppBar color={"primary".main} elevation={0}>
        <Toolbar variant="dense" sx={{ minHeight: "auto", py: "8px" }}>
          <Box mx={4}>
            <IconButton></IconButton>
          </Box>
          <Box mx={3}>
            <Typography sx={{ color: "white", fontWeight: "bold" }}>
              견적비교
            </Typography>
          </Box>
          <Box mx={3}>
            <Typography sx={{ color: "white", fontWeight: "bold" }}>
              핸드캐리
            </Typography>
          </Box>
          <Box mx={3}>
            <Typography sx={{ color: "white", fontWeight: "bold" }}>
              마이페이지
            </Typography>
          </Box>
          <Button
            sx={{
              backgroundColor: "#11ac0a",
              color: "white",
              borderRadius: 5,
              ":hover": { backgroundColor: "#11ac0a" },
            }}
          >
            Log In / Sign Up{" "}
          </Button>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
